*, *::before, *::after {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

html {
  scroll-behavior: smooth;
}

body {
  background-image: linear-gradient(135deg, #9b6464 0%, #3b52a3 100%);
  font-family: "Inter",sans-serif;
  color: #343a40;
  line-height: 1;
}

h3 {
  font-size: 24px;
  letter-spacing: -0.5px;
  margin: 0;
}
header {
  font-family: 'Montserrat', sans-serif;
  color: white;
  padding: 3rem 0;
  text-align: center;
  margin-top: 90px;
  /* background-image: linear-gradient(135deg, #9b6464 0%, #3b52a3 100%); */
}

section {
  background-color: white;
  margin: 2rem 2rem;
  padding: 2rem;
  box-shadow: 0 13px 4px rgba(0, 0, 0, 0.1);
  border-radius: 5px;
  position: relative;
  border: 1px solid #9b6464;
}

section:nth-child(3) {
  width: 100%;
  margin: 0;
}

form input {
  margin-bottom: 5px;
}

form button {
  margin-top:5px;
}




section p {
  font-size: 1rem;
  font-weight: 500;

  line-height: 1.6;

}

.card-text {
  font-size: 0.9rem;
}





.card {
  width: 90%;
  height: 420px;
  margin: 10px auto;
}

.left {
  position: absolute;
  top: 50%;
  right: 95.5%;
  font-size: 30px;
}

.right {
  position: absolute;
  top: 50%;
  left: 95.5%;
  font-size: 30px;
}

.fade-in {
  opacity: 0;
  transform: translateX(-20px);
  transition: opacity 1.5s, transform 0.5s;
}

.fade-in.active {
  opacity: 1;
  transform: translateX(0);
}
